// import React from 'react'
import ReactDOM from 'react-dom'
import "../styles/styleBar.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope, faGolfBall, faGear } from '@fortawesome/free-solid-svg-icons'


function SideBar() {

   const element = <FontAwesomeIcon icon={faGrid2} />

  return (
    <div id = "sideBarItems">
      <p>Medico Sales</p>
      <div id = "sideBarButtons">
        <div id = "buttons">
          <button id = "change_color"> {element} Dashboard</button>
          <button>Lab Test</button>
          <button>Appointment</button>
          <button>Medicine Order</button>
          <button>Payment</button>
          <button> <FontAwesomeIcon icon={faGear} /> Settings</button>
          </div>
      </div>
    </div>
  )
}

export default SideBar


